import React from "react";

import "./NavigationBar.css";

const NavigationBar = () => {
  return (
    <nav className="nav-container">
      <img className="nav-logo" src="" alt="logo" />
      <a>Features</a>
      <a>Team</a>
      <a>Download</a>
    </nav>
  );
};

export default NavigationBar;
